export const MenuData = [
    {
        title: 'Top 3 Likes',
        path: '/Bylikes',
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
      },
      {
        title: 'By Employee Id',
        path: '/EmployeeId',
        icon: <IoIcons.IoIosAdd />,
        cName: 'nav-text'
      },
      {
        title: 'By Posted Date',
        path: '/ByDate',
        icon: <FaIcons.FaCartPlus />,
        cName: 'nav-text'
      },
      {
        title: 'By Category',
        path: '/ByCategory',
        icon: <FaIcons.FaCartPlus />,
        cName: 'nav-text'
      }
]
